import React from 'react';
import './Footer.css';
const Footer = () => {
  return (
    
      <>
  <h2>Fixed/Sticky Footer Example</h2>
  <p>The footer is placed at the bottom of the page.</p>
  <div className="footer">
    <p>Footer</p>
  </div>
</>
    
  );
}

export default Footer;
